import React from 'react'

export default function BlogList({blogs, title}) {
  return (
    <div children="blog-list">
      {title}
      {blogs.map((blog) => (
            <div className='blog-preview' key={blog.id}>
             <h2> {blog.title}</h2>
             <p> Witter by {blog.author}</p>
              </div>
           ))}

    </div>
  )
}
